// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/proxy/transparent/TransparentUpgradeableProxy.sol";

/**
 * @title Major Factory Contract
 * @notice HorseRace is a NFT horse racing metaverse based on pylogon
 * @notice ....
 *
 * @notice Website: https://horse-racing.io/
 * @notice Docs: https://horse-racing.gitbook.io/horse-racing-docs/
 * 
 * @dev Version: v1.0.1
 */
contract BalckListProxy is TransparentUpgradeableProxy {
    /** @notice Version of contract */
    string constant public LASTEST_VERSION = "v1.0.1";

    /** @notice Zero bytes for transparent upgradeable proxy data */
    bytes constant public DEFAULT_DATA = "";

    constructor(
        address logic, address admin
    ) TransparentUpgradeableProxy(logic, admin, DEFAULT_DATA) {

    }

    function getImplementation() public view returns (address) {
        return _implementation();
    }
}

